    false,nt"url": null,nt"notes": "This narrative report for Malheur National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1947.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include grazing and fur harvesting. The
    public relations section of the report describes recreational uses, Refuge visitors,
    and Refuge participation. Items of interest are attached.",nt"license_title":
